    tempo: '02:00:00'
  }, {
    tarefa: 'JavaScript',
    tempo: '01:00:00'
  }, {
    tarefa: 'TypeScript',
    tempo: '03:00:00'
  }
  ]
  return(
    <aside className={style.listaTarefas}>
      <h2>Estudos do dia</h2>
      <ul>
        {tarefas.map((item, index) => (
          <li key={index} className={style.item}>
            <h3>{item.tarefa}</h3>
            <span>{item.tempo}</span>
          </li>
        ))}
      </ul>
    </aside>
  )
}

export default Lista
